function checkform(theform)
{
	if(theform.pccontent.value=="")
	{
		alert("Please Enter your Reviews!");
		theform.pccontent.focus();
		return false;
	}
	if(theform.pcname.value=="")
	{
		alert("Please Enter your Name!");
		theform.pcname.focus();
		return false;
	}
	return true;
}
